import amber from '@material-ui/core/colors/amber'
import createMuiTheme from '@material-ui/core/styles'

const lightTheme = {
    palette: {
        primary: amber,
        type: 'light',
        secondary: {
            main: '#5c6bc0',
            },
        },
    }


export default lightTheme
